import React, { Component } from "react";

class Tasks extends Component {
  render() {
      const{tasks}=this.props
    return (
        <React.Fragment>
            {tasks.map((task)=>{
      return <li name='Tasks' key={task.id} style={{height:'30px',padding:'10px',border:'1px solid grey',margin:'5px'}}>
        {task.content}
      </li>
            })
  }
      </React.Fragment>
    );
  }
}

export default Tasks;
